import React from 'react';
import '../App.css';
import Form from './components/Form';

export default class Acess extends React.Component {
    render(){
        return(
            <div className="App">
                <header className="App-header">
                <Form teste={this.teste}/> 
                </header>
            </div>
        );
    }
}
